import React from "react";

const BannerImage = ({ src, alt, style, aspectRatio }) => {
  const containerStyle = {
    position: "relative",
    overflow: "hidden",
    ...style,
  };

  const imageStyle = {
    width: "100%",
    height: "auto",
    display: "block",
  };

  if (aspectRatio) {
    let aspectPercentage = "auto";
    if (aspectRatio.desktop) {
      const [width, height] = aspectRatio.desktop.split(":").map(parseFloat);
      if (!isNaN(width) && !isNaN(height)) {
        aspectPercentage = (height / width) * 100;
      }
    }

    containerStyle.paddingTop = aspectPercentage + "%";

    if (aspectRatio.mobile && window.innerWidth < 768) {
      const [width, height] = aspectRatio.mobile.split(":").map(parseFloat);
      if (!isNaN(width) && !isNaN(height)) {
        aspectPercentage = (height / width) * 100;
        containerStyle.paddingTop = aspectPercentage + "%";
      }
    }

    imageStyle.position = "absolute";
    imageStyle.top = "0";
    imageStyle.left = "0";
    imageStyle.width = "100%";
    imageStyle.height = "100%";
  }
  return (
    <div style={containerStyle}>
        <img src={src} alt={alt} style={imageStyle} />
    </div>
  );
};

export default BannerImage;
